const { Sequelize: { Model } } = require( 'sequelize' );
const { OnlineMerchantTag: OnlineMerchantTagSchema } = require( '../schema' );

class OnlineMerchantTag extends Model {}

module.exports = sequelize => {

    OnlineMerchantTag.init( OnlineMerchantTagSchema, { sequelize, tableName: 'online_merchant_tags', underscored: true, timestamps: true } );
    return OnlineMerchantTag;

};
